  function loadImg(imgSrcArr) {
    function dispatch(i) {
      if (!imgSrcArr[i]) {
        return
      }
      let img = new Image();
      img.src = imgSrcArr[i];
      img.onload = () => {
        // 
        dispatch(i + 1)
      }
    }

    dispatch(0)
  }
  loadImg(imgSrcArr)
